INSERT INTO MT_QUESTIONAIR VALUES (37134, 'F', 50, 'มัธยมศึกษา', 'รับจ้าง', 'ผู้สูงอายุ', 4, 4, 3, 3, 3, 3, 4, 4, 3, 4, 4, 4, 3, 'ถ้ามีเรื่องเกี่ยวกับกับ อสม. หรือ อผส. ก็ขอแนะนำให้ติดต่อกับทาง อผส. หรือทางอนามัยโดยตรง แนะนำเครื่องหมายหรือแบบฟอร์มที่คนเห็นแล้วสามารถรู้ได้ทันทีว่าเป็น อผส.', 789, 2553, 5, 1273424400, 2, NULL, 71, NULL);
INSERT INTO MT_QUESTIONAIR VALUES (37135, 'F', 48, 'ปวช. / ปวส.', 'รับราชการ', 'ผู้สูงอายุ', 5, 5, 4, 4, 4, 4, 4, 4, 4, 4, 5, 4, 3, 'ต้องการให้มีเครื่องหมายหรือเครื่องแบบวึ่งบ่งบอกถึงการเป็น อผส. ขณะที่ลงพื้นที่ด้วย มีการติดต่อประสานงานโดยตรงกับ อผส. ในแต่ละหมู่บ้าน ตำบล ข้อมูลข่าวสารต่างๆ ฯลฯ อย่างสม่ำเสมอ', 789, 2553, 5, 1273424400, 2, NULL, 71, NULL);
INSERT INTO MT_QUESTIONAIR VALUES (37136, 'F', 43, 'มัธยมศึกษา', 'ค้าขาย', 'ผู้สูงอายุ', 4, 5, 5, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 'ต้องการให้มีเครื่องแบบหรือสัญลักษณ์ของ อผส. ในการลงปฏิบัติหน้าที่ เพื่อที่จะสะดวกหรือทราบได้ทันทีว่าเป็น อผส. ติดต่อโดยตรงกับอนามัย', 789, 2553, 5, 1273424400, 2, NULL, 71, NULL);
